import React from "react";
import './information.css'

export default class Infromation extends React.Component {
    render() {
        return (
            <div className={'information'}>
            <span>I am 18 years old and I am a first year student of the faculty of applied mathematics and informatics. First of all, I'd like to say that except of being a field I want to work in programming is my passion as I can learn it all day long. Moreover, I have good communication skills which allow me to effectively communicate with a wide range of people. To tell more, I'd like to admit that I am rather focused and hardworking while chasing my goals. That is why, I believe that I can benefit the company I work for.</span>
                <br/>
                <hr/>
            </div>
        )
    }
}
